module.exports = "<ion-header>\r\n  <ion-toolbar>\r\n    <ion-title>Privacy Policy</ion-title>\r\n  </ion-toolbar>\r\n</ion-header>\r\n\r\n<ion-content >\r\n<ion-card padding>\r\n  \r\n  <p>The ISerb Privacy Policy</p>\r\n   <p>  ISerb respects your right to privacy.</p> \r\n   <p>   ISerb’s Privacy policy collates all the personal information that the company may collect, including how we may use these set of information, and other important details pertaining to the protection of the users or clients’ privacy and data protection.\r\n      It is ISerb’s policy to comply with all applicable Philippine privacy and data protection laws.\r\n      This commitment reflects the value we place on earning and keeping the trust of our clients, loyal and returning customers, business development stakeholders or partners and others who share their personal information with us.\r\n      This Policy applies to all Internet sites and mobile applications operated by or on behalf of ISerb and includes other entities worldwide affiliated with ISerb.\r\n      This also applies to personal information ISerb may otherwise collect:\r\n     <p>(i) Through our products and services;</p> \r\n     <p> (ii) when you interact with us by means other than a ISerb Internet Site or App, i.e. in person, by telephone, or via other means of telecommunications; and</p>\r\n     <p>  (iii) from our employees,third party investigators, and other business partners (collectively “Business Partners”).</p>\r\n     <p> \r\n      1.\tISerb Privacy Policy </p>\r\n      <p>ISerb is a mobile application software (“App”) available on the Google Play Store (“App”) which you have downloaded onto your mobile phone, cellphone or handheld device (Device).\r\n      To the extent required by applicable law, whenever ISerb collects personal information, ISerb will:</p>\r\n     <p> • Provide timely and appropriate notice to you about our data practices;</p>\r\n     <p> • Collect your personal information only for specified and legitimate purposes;</p>\r\n     <p> • The information we collect will be relevant, adequate and not excessive for the purposes for which it is collected;</p>\r\n     <p> • Process your personal information in a manner consistent with the purposes for which it was originally collected or to which you have subsequently consented;</p>\r\n     <p>• Take commercially reasonable steps to ensure that your personal information is reliable for its intended use, accurate, complete, and, where necessary, kept up-to-date;</p>\r\n     <p>• Not use your personal information for direct marketing purposes without giving you an opportunity to “opt-out”; and</p>\r\n     <p>• Take appropriate measures, by contract or otherwise, to provide adequate protection for personal information that is disclosed to a third party or transferred to another country, including transfers within ISerb;</p>\r\n     <p>This Policy constitutes as an inseparable part of ISerb Credit Agreement.</p>\r\n       \r\n      <p>1.\tPersonal Information ISerb Collects</p>\r\n      <p>ISerb collects the following types of personal information:</p>\r\n      \r\n      <p>1.\tInformation You Provide\r\n          ISerb collects the personal information you provide us, which may include:</p>\r\n      <p>1.\tcontact information, such as your name, company name, job title, address, e-mail address, and phone number;</p>\r\n      <p>2.\tadditional information about you to help us get to know you better, such as your gender, age, date of birth, nationality, professional associations and registration numbers, information about how you use our products, and demographic information;</p>\r\n      <p>3.\tlog-in information, including,</p>\r\n      <p>4.\tif applicable, social media account information for login purposes,</p>\r\n      <p>5.\tif applicable; information about your preferences, such as your preferred methods of communication and product types in which you are interested;</p>\r\n      <p>6.\tComments, questions, requests, and orders you may make;</p>\r\n       \r\n      <p>It is understood that when you have submitted your information to ISerb, you are expressly consenting to the collection and processing of such information for whichever purpose it may serve under the agreement.</p>\r\n       \r\n      <p>Information Automatically Gathered from Your Device\r\n      Device information. ISerb may collect technical information about your devices, such as device type, browser type, IP address, operating system, and device identifier.\r\n      ISerb collects this information automatically from your device and web browser through cookies and similar technologies subject to your consent.\r\n      Information about how you interact with us. ISerb may collect technical data about your usage of the ISerb App and how you interact with our digital advertisements and promotions.\r\n      ISerb collects this information using cookies and similar technologies subject to your consent.\r\n      Location information. ISerb may collect location information, including precise real-time location information from your device and imprecise location information derived from, for example, your IP address.\r\n      ISerb Apps will NOT access precise-real time location information from your device unless you grant permission to do so.\r\n      ISerb’s access to the location is for the protection of ISerb as our services are only rendered for those who are located in the Philippines.\r\n      ISerb’s location access is limited for the purpose of granting the loan application and other allied services, if applicable.</p>\r\n       \r\n      <p>Information from Business Partners and other Third Parties\r\n      <p>ISerb may collect personal information through our Business Partners.\r\n      This information may include contact information, such as name, company name, job title, address, e-mail address, and phone number for verification and validation purposes.\r\n      ISerb may also obtain personal information from other third-party sources, including publicly and commercially available sources.\r\n      We may combine the information we receive from our Business Partners and other third-party sources with information that we collect from you or your device, as described above.</p>\r\n       \r\n      <p>1.\tISerb’s Usage of Personal Information</p>\r\n      <p>ISerb may use your personal information to:</p>\r\n      <p>Develop and manage our relationships with you and our Business Partners. This may include: (i) delivering services or carrying out transactions that you or our Business Partners have requested;</p>\r\n      <p>(ii) Providing information about ISerb products, services, and transactions, and advertisements, that may be of interest to you;</p>\r\n      <p>(iii) Providing you and our Business Partners a more consistent experience in interacting with ISerb, including by learning more about you and how you use and interact with ISerb Internet Sites, Apps, products, and services; and,</p>\r\n      <p>(iv) Planning, managing, and performing under our contractual relationships with our Business Partners.</p>\r\n       \r\n      <p>Communicate with you. This may include:</p>\r\n      <p>1.\tinforming you of ISerb products, services, and promotional activities that may be of interest to you;</p>\r\n      <p>2.\tproviding information about relevant ISerb products, services, and transactions, including, for example, pricing, information about product or service improvements;</p>\r\n      <p>3.\tresponding to questions or inquiries that you make, including customer service requests; and,</p>\r\n      <p>4.\tInviting you to participate in, or informing you of the results of, customer satisfaction or market research surveys.</p>\r\n      <p>Provide and improve our Internet Sites, Apps, products, and services. This may include:</p>\r\n      <p>1.\tcustomizing them to your preferences or interests, making them more compatible with your technology, or otherwise making them easier to use;</p>\r\n      <p>2.\tmaintaining the security of and otherwise protecting them; and,</p>\r\n      <p>3.\tDeveloping new ISerb Internet Sites, Apps, products and services.</p>\r\n      <p>Address legal issues. This may include:</p>\r\n      <p>1.\tcomplying with our obligations to retain certain business records for minimum retention periods;</p>\r\n      <p>2.\testablishing, exercising, or defending legal claims;</p>\r\n      <p>3.\tcomplying with laws, regulations, court orders, or another; or other legal process;</p>\r\n      <p>4.\tdetecting, preventing, and responding to fraud, intellectual property infringement, violation of our contracts or agreements, violations of law, or other misuses of ISerb Internet Sites, Apps, products or services; and,</p>\r\n      <p>5.\tprotecting ISerb’s rights or property, or yours or others’ health, safety, welfare, rights, or property.</p>\r\n      <p>ISerb may also use your personal information for other uses consistent with the context in which the information was collected or with your consent.\r\n      ISerb may anonymize or aggregate any of the information we collect and use it for any purpose, including for research and product-development purposes. Such information will not identify you individually.</p>\r\n       \r\n      <p>1.\tSharing of Personal Information</p>\r\n      <p>ISerb will not disclose your personal information except as described here:</p>\r\n      <p>•\tISerb may share your personal information with third parties we hire to perform support services for us such as but not limited to background investigation, and skip tracing among others.</p>\r\n       \r\n      <p>•\tThese third parties are required to use the personal information we share with them only to perform services on our behalf and to treat your personal information in compliance with all applicable privacy and data protection laws.</p>\r\n       \r\n      <p>•\tIn some cases, ISerb may share your personal information with third parties who partner with us to provide products and services to our customers.</p>\r\n       \r\n      <p>•\tIf so, we will require our Business Partners to use that information in a manner consistent with this Policy, any applicable Specific Privacy Statements, and all applicable privacy and data protection laws.</p>\r\n       \r\n      <p>•\tISerb may share your personal information with third parties when we have a good faith belief that disclosure is necessary:</p>\r\n       \r\n      <p>1.\tto comply with a law, regulation, court order, or other legal processes;</p>\r\n      <p>2.\tto detect, prevent, and respond to fraud, intellectual property infringement, violation of our contracts or agreements, violation of the law, or another misuse of ISerb Internet Sites, Apps, products or services;</p>\r\n      <p>3.\tto protect ISerb rights or property or yours or others’ health, safety, welfare, rights, or property; or</p>\r\n      <p>4.\tUnder similar circumstances. If such an event occurs, we will take appropriate steps to protect your personal information.</p>\r\n       \r\n      <p>•\tISerb may share your personal information with third parties in connection with the sale, purchase, merger, reorganization, liquidation or dissolution of ISerb or a ISerb business unit, or under similar circumstances.\r\n       \r\n      If such an event occurs, we will take appropriate steps to protect your personal information.</p>\r\n     <p> •\tISerb may share your information with your permission or at your request.\r\n      ISerb may share anonymized or aggregated information internally and with third parties for any purpose. Such information will not identify you individually.</p>\r\n       \r\n      <p>5. Security Safeguards</p>\r\n      <p>Your personal information will generally be stored in ISerb databases maintained by our service providers.\r\n      Many of these databases are stored on servers located in the Philippines. ISerb takes appropriate measures, by contract or otherwise, to provide adequate protection for personal information that is disclosed to a third party or transferred to another country, including transfers within ISerb.\r\n      ISerb maintains reasonable safeguards to protect the confidentiality, security, and integrity of your personal information.\r\n      Although we use security measures to help protect your personal information against unauthorized disclosure, misuse, or alteration, as is the case with all computer networks linked to the Internet, we cannot guarantee the security of information provided over the Internet and will not be responsible for breaches of security beyond our reasonable control.\r\n      ISerb shall not be held accountable or legally liable for any data breach, misuse, disclosure or unlawful sharing due to the fault of its users’ failure to protect and secure their username and password or some other form of negligence.</p>\r\n       \r\n      <p>6. Revision of Privacy Policy</p>\r\n      <p>Changes to this Privacy Policy will be posted on the ISerb website and app, along with information on any material changes.\r\n      ISerb reserves the right to update or modify this Policy and any Specific Privacy Statements at any time and without prior notice.\r\n      Any modifications will apply only to the personal information we may have collected and those we will collect after the posting.\r\n      This Privacy Policy was last revised on August 2019.</p>\r\n\r\n      <div>\r\n          <div float-left class=\"my-checkbox\">\r\n            <ion-checkbox [(ngModel)]=\"ischeckedbox\" (click)=\"onCheckeds()\">\r\n            </ion-checkbox>\r\n            <ion-label class=\"agree_label\" text-uppercase>&nbsp;&nbsp; I AGREE</ion-label>\r\n          </div>\r\n          \r\n        </div>\r\n        <br>\r\n        <div *ngIf=\"continue\">\r\n        <ion-button float-right color=\"dark\" (click)=\"ondismiss()\">CONTINUE</ion-button>\r\n      </div>\r\n      \r\n     \r\n    </ion-card>\r\n\r\n</ion-content>\r\n"

